const EmptyPlaces = () => {
  const hasOutlet = useOutlet();
  const navigate = useNavigate()
  return (
    <>
      {hasOutlet ? (
        <Outlet />
      ) : (
        <div className="wrapper">
          <div className="card" onClick={()=> navigate(path)}>Ordenary Rooms</div>
          <div className="card" onClick={()=> navigate(path)}>Luxury Rooms</div>
          <div className="card" onClick={()=> navigate(path)}>Cottages</div>
        </div>
      )}
    </>
  );
};

export default EmptyPlaces;
